-- Fix create and complete dates for Kofax batch records in ETL tables.

-- Reset COMPLETE_DTs to null to fix incorrect earlier repair.
update CORP_ETL_MFB_BATCH_STG
set COMPLETE_DT = null
where 
  COMPLETE_DT = to_date('2015-04-02 17:53:50','YYYY-MM-DD HH24:MI:SS') and 
  BATCH_COMPLETE_DT = COMPLETE_DT;
  
commit;
  
update CORP_ETL_MFB_BATCH
set COMPLETE_DT = null
where 
  COMPLETE_DT = to_date('2015-04-02 17:53:50','YYYY-MM-DD HH24:MI:SS') and 
  BATCH_COMPLETE_DT = COMPLETE_DT;
  
commit;

